import React from "react";
import styles from "./SocialMedia.module.css";

const SocialMedia = () => {
  return (
    <div className={styles.container}>
      <button onClick={"https://www.facebook.com/"} className={styles.button} />
      <button url="https://www.instagram.com/" className={styles.button} style={{
  backgroundColor: "var(--color-button)"}} />
      <button url="https://www.twitter.com/" className={styles.button} />
      <button url="https://www.linkedin.com/" className={styles.button} />
    </div>
  );
};

export default SocialMedia;
